    private async Task BorrarProductor(Productor productor)
    {
        var responseHttp = await repositorio.Delete($"api/Productores/{productor.ProductorId}");
        if (responseHttp.Error)
        {
            Console.WriteLine(responseHttp.HttpResponseMessage.StatusCode);
            await mostrarMensajes.MostrarMensajeError(await responseHttp.GetBody());
        }
        else
        {
            await Cargar();
        }

    }
    private async Task VolverOrganizadorList(int organizadorId)
    {
       

        var responseHttp = await repositorio.Get<Organizador>("api/Organizadores/" + organizadorId);
        Organizador organizador = responseHttp.Response;

        navigationManager.NavigateTo("/admin/Organizadores/" + organizador.GrupoId + "/" + organizador.Url);



    }

